import styled from "styled-components";
import { Button } from 'antd';

export const StyledButton = styled(Button)`
    background: transparent;
    border-radius: 20px;
    border-color:black;
    width:170px;
    height:40px;
    font-size:18px;
    display: inline;
    margin-top: 30px;
`
